import React from "react";
import { NavLink, useLocation } from "react-router-dom";

function Search(props) {
  let location = useLocation();
  console.log(location);
  return (
    <div>
      <NavLink to="/">HomePage</NavLink>
    </div>
  );
}

export default Search;
